	<script>
	    var m;

	    function checkErrorMessage() {
	        var loginbtn, errorMessage = document.getElementById( "error-message" );
	        if ( errorMessage ) {
	            var text = errorMessage.textContent;
	            if ( text ) {
	                errorMessage.style.display = "block";
	                loginbtn = document.getElementById( 'loginbtn' );
	                if ( loginbtn ) {
	                    loginbtn.style.marginTop = '10px';
	                }
	            } else {
	                errorMessage.style.display = "none";
	            }
	        }
	    }

	    function init() {
	        checkErrorMessage();
	    }

	    function scrollToCorrectPos() {
	        if ( m.matches && window.scrollTo ) {
	            window.scrollTo( 0, 0 );
	        }
	    }

	    function setupSmallDeviceMql() {
	        return window.matchMedia( "screen and (max-width: 640px) and (orientation: landscape)" );
	    }

	    m = setupSmallDeviceMql();
	    scrollToCorrectPos();

	</script>

		.background {

			z-index: 1;
		}

	    .sense-login-container

	        margin-right: auto;
	        max-width: 350px;
	        font-size: 13px;
	        background: #364148;
	        color: #000000;
	        position: relative;
	        z-index: 2;

			padding-bottom: 20px;
		}
		
		form#login-form label
		{
			font-size: 13 px;
			padding-bottom: 10px;
		}

	    input
	    {
	        height: 28px;
	        margin-top: 5px;
	        margin-bottom: 10px;
	        outline: none;
	        border-radius: 6px;

	        border: 1px solid #CCC;
	        box-shadow: none;

	        -moz-box-sizing: border-box;
	        box-sizing: border-box;

	    input[type="text"]

	    }

	    input[type='password']
	    {
	        width: 100%;
	    }

	    input[type='submit']
	    {
	        float: right;
	        background-color: transparent;
	        box-shadow: none;
	        color: #0AA89F;
	        border: solid 1px #cccccc;
	        border-radius: 6px;
	        outline: none;
	        cursor: pointer;
	        height: 28px;
	        line-height: 24px;
	        padding: 1px 10px;
	        margin: 30px 0 0 0;
	        font-size: 13px;
	        font-weight: bold;
	    }

	    input[type='submit']:hover
	    {
	        border: solid 1px #595959;
	    }

	    input[type='submit']:active
	    {
				color: #FFFFFF;
				background-color: #595959;
			}

		.error-message {
			display: none;
			color: rgba(230, 78, 78, 1.0);
			background-color: rgba(230, 78, 78, 0.1);
			border-color: rgba(230, 78, 78, 0.3);
			cursor: default;
			padding: 10px 10px 10px 10px;
			border: 1px solid;
			-webkit-border-radius: 6px;
			-moz-border-radius: 6px;
			border-radius: 6px;
			clear: both;
			-webkit-text-overflow: ellipsis;
			text-overflow: ellipsis;
			overflow: hidden;
		}

	    }
